import React, { Component } from "react";
import "./App.css";
import Navbar from "./component/navbar";
import Signup from "./component/signup";
import Introtext from "./component/introtext";
class App extends Component {
  render() {
    return (
      <div>
        <Navbar />
        <Introtext />
        <Signup />
      </div>
    );
  }
}

export default App;
